.page {
  scroll-behavior: smooth;

  &__body {
    background-color: $c-gray;
    box-sizing: border-box;
    margin: 0;
    font-family: "Inter", sans-serif;
    font-weight: 400;
    font-style: normal;
    position: relative;
    scroll-behavior: smooth;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__header {
    max-width: 1440px;
    margin: 0 auto;
  }

  &__welcome {
    margin-bottom: 64px;
  }

  &__we-bake {
    @include onTablet {
      margin-bottom: 98px;
    }

    @include onDesktop {
      margin-bottom: 124px;
    }
  }
}

