@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onMobile {
  @media (min-width: 1px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 640px) {
    @content;
  }
}
@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin onFullHD {
  @media (min-width: 1200px) {
    @content;
